const int N=4e5+7;


std::vector<int> p;

int check(ll st,int len){
	static bool mrk[(int)5e6+7];
	memset(mrk,1,sizeof(bool)*len);
	if(st==1)mrk[0]=false;
	for(auto pr:p){
		if(pr>=st+len)break;
		for(ll j=max((ll)pr*pr,((ll)st/pr+!!(st%pr))*pr);j<st+len;j+=pr)
			mrk[j-st]=false;
	}int res=0;
	for(int i=0;i<len;++i)
		res+=mrk[i];
	return res;
}

ll pi(ll n){
	ll b=5000000;
	return (n/b?tab[n/b-1]:0)+check(n/b*b+1,n%b);
}

bool mrk[N];

void Main(){
	for(int i=2;i<N;++i){
		if(!mrk[i])p.push_back(i);
		for(int j:p){
			if(i*j>=N)break;
			mrk[i*j]=true;
			if(i%j==0)break;
		}
	}
	for(int i=1;i<=20000;++i)
    	tab[i]=tab[i-1]-tab[i];
  	for(int i=1;i<=20000;++i)
    	tab[i]+=tab[i-1];
	int T;cin>>T;
	while(T--){
		ll n;cin>>n;
		ll D=pi(n)-pi(n/2);
		cout<<n-(n-1-D)/2<<"\n";
	}
}

